@Jean Bethencourt Colombia's population is 50 million and no need to misinform neither, it's not 2 people and a donkey. New Zealand's population is 5 million and rapidly growing due to immigration. 

Colombia sucks but who cares. They produce more than 60% of their electric power frow renewables and that's why it has to be mentioned when the guy of the initial comment stated that Spain is leading it, when they produce only 30% from renewables. New Zealand is more than 70%, Norway is more than 98%.

Look I don't hate your country Spain, I love it but let's just stick to the facts.
